package com.studio.model;import javax.persistence.Column;import javax.persistence.GeneratedValue;import javax.persistence.Id;import java.util.Date;/** * description: * author:          song * createDate:      2017/10/25 */public class BaseModel {    @Id    @Column(name = "id")    @GeneratedValue(generator = "UUID")    private String id;    @Column(name = "CreateUser")    private String createUser;    @Column(name = "CreateTime")    private Date createTime;    @Column(name = "LastUpdateUser")    private String lastUpdateUser;    @Column(name = "LastUpdateTime")    private Date lastUpdateTime;    public String getID() {        return id;    }    public void setID(String id) {        this.id = id;    }    public String getCreateUser() {        return createUser;    }    public void setCreateUser(String createUser) {        this.createUser = createUser;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getLastUpdateUser() {        return lastUpdateUser;    }    public void setLastUpdateUser(String lastUpdateUser) {        this.lastUpdateUser = lastUpdateUser;    }    public Date getLastUpdateTime() {        return lastUpdateTime;    }    public void setLastUpdateTime(Date lastUpdateTime) {        this.lastUpdateTime = lastUpdateTime;    }}